package com.zhzx.dao.bean.prod;import com.zhzx.dao.bean.BaseBean;public class ProdPlanDetail extends BaseBean {		/**	*活动明细编号	*/	private String id;		/**	*活动编号	*/	private String planno;		/**	*产品编号	*/	private String prodno;		/**	*排列序号	*/	private String order;		/**	*创建时间	*/	private String createtime;			public String getId() {	    return this.id;	}	public void setId(String id) {	    this.id=id;	}	public String getPlanno() {	    return this.planno;	}	public void setPlanno(String planno) {	    this.planno=planno;	}	public String getProdno() {	    return this.prodno;	}	public void setProdno(String prodno) {	    this.prodno=prodno;	}	public String getOrder() {	    return this.order;	}	public void setOrder(String order) {	    this.order=order;	}	public String getCreatetime() {	    return this.createtime;	}	public void setCreatetime(String createtime) {	    this.createtime=createtime;	}}